import './App.css';
import { Outlet } from 'react-router-dom';
import NavBar from './views/layouts/navbar';
import Footer from './views/layouts/footer';

function App() {
  return (
    <div className="">
      <NavBar></NavBar>
      <Outlet></Outlet>
      <Footer></Footer>
    </div>
  );
}

export default App;
